export const PRODUCT = 'PRODUCT';
export const PRICE = 'PRICE';
export const DETAILS = 'DETAILS';

export const productItem = (product, id) => ({
  type: PRODUCT,
  product,
  id,
});

export const productPrice = (price, id, quantity) => ({
  type: PRICE,
  price,
  id,
  quantity,
});

export const productDetails = (toogle, product) => ({
  type: DETAILS,
  toogle,
  product,
});
